package org.xipki.ca.gateway.acme;

import org.xipki.ca.gateway.acme.type.AuthzStatus;
import org.xipki.security.util.JSON;

public class DummyMain {

  static String a =
      "algo=SHA1WITHECDSA,password=1234,keystore=base64:";

  static String b =
      "algo=SHA1withECDSA,password=1234,keystore=base64:";

  public static void main(String[] args) {
    try {
      if (a.length() != b.length()) {
        System.out.println("length unmatch");
        return;
      }

      for (int i = 0; i < a.length(); i++) {
        char ai = a.charAt(i);
        char bi = b.charAt(i);

        if (ai != bi) {
          System.out.println("index " + i + ": " + ai + "-" + bi);
        }
      }

    } catch (Exception e) {
      e.printStackTrace();
    }
  }

}
